export const actionTypes = {
    GET_ALL_ANNOUNCEMENTS_REQUEST: 'GET_ALL_ANNOUNCEMENTS_REQUEST',
    GET_ALL_ANNOUNCEMENTS_SUCCESS: 'GET_ALL_ANNOUNCEMENTS_SUCCESS',
    GET_INACTIVE_ANNOUNCEMENTS_REQUEST: 'GET_INACTIVE_ANNOUNCEMENTS_REQUEST',
    GET_INACTIVE_ANNOUNCEMENTS_SUCCESS: 'GET_INACTIVE_ANNOUNCEMENTS_SUCCESS'
};

export function getAllAnnouncements(payload) {
    return { type: actionTypes.GET_ALL_ANNOUNCEMENTS_REQUEST, payload };
}

export function getAllAnnouncementsSuccess(payload) {
    return { type: actionTypes.GET_ALL_ANNOUNCEMENTS_SUCCESS, payload };
}

export function getInactiveAnnouncements(payload) {
    return { type: actionTypes.GET_INACTIVE_ANNOUNCEMENTS_REQUEST, payload };
}

export function getInactiveAnnouncementsSuccess(payload) {
    return { type: actionTypes.GET_INACTIVE_ANNOUNCEMENTS_SUCCESS, payload };
}
